import React, { Component } from 'react'

export default class ListItem extends Component {
    onCheck(id){
        console.log(id)
    }
    render() {
        return (
            <li style={todoItem}>
                <input type='checkbox' onChange={this.onCheck(this.props.key)}/>
                <div style={name}>{this.props.name}</div>
                <button style={deleteBtn}>X</button>
                <div style={date}>{this.props.date}</div>
            </li>
        )
    }
}

const todoItem = {
    margin: '10px auto'
}

const name = {
    display: 'inline-block',
}

const deleteBtn = {
    float: 'right',
}

const date = {
    fontSize: '12px'
}
